#include <vector>

using namespace std;

class Solution {
public:
    void swap(vector<int>& nums, int l, int r)
    {
        int size = nums.size();
        if (l >= size || r >= size) { return; }
        if (l < 0 || r < 0) { return; }
        nums[l] ^= nums[r];
        nums[r] ^= nums[l];
        nums[l] ^= nums[r];
    }

    void quick_sort(vector<int>& nums, int lhs, int rhs)
    {
        int size = nums.size();
        if (lhs >= size || rhs >= size) { return; }
        if (lhs < 0 || rhs < 0) { return; }
        if (lhs > rhs) {
            return;
        }
        int pivot = lhs;
        int left = pivot + 1, right = rhs;
        while(left < right) {
            while(nums[left] <= nums[pivot] && left <= rhs) left++;
            while(nums[right] > nums[pivot] && right >= lhs) right--;
            if (left < right) {
                swap(nums, left, right);
            }
        }
        if (nums[pivot] > nums[right]) {
            swap(nums, pivot, right);
        }
        quick_sort(nums, lhs, right - 1);
        quick_sort(nums, right + 1, rhs);
    }

    long long minimumRemoval(vector<int>& beans) {
        quick_sort(beans, 0, beans.size() - 1);
        long long sum = 0, z_max = 0;
        for (int i = 0; i < beans.size(); i++)
        {
            sum += beans[i];
            long long value = (beans.size() - i) * beans[i];
            z_max = z_max > value ? z_max : value ;
        }
        return sum - z_max;
    }
};


